{% extends 'base.html' %}
<script src="{{ url_for('static', filename='js/gallery.js') }}"></script>


{% block title %}Dock - Photos{% endblock %}
{% block category %}Photos{% endblock %}
{% block content %}
<div>HandPick Of the Week</div>
<div class="gallery">
    {% for photo in photos %}
    <a href="{{ url_for('static', filename='photos/' + photo.filename) }}" class="photo" onclick="return showLightbox(this);">
        <img src="{{ url_for('static', filename='photos/' + photo.filename) }}" alt="{{ photo.alt }}">
        <div class="photo-text">{{ photo.description }}</div>
    </a>
    {% endfor %}
</div>
<div id="lightbox">
    <img id="lightbox-img" onclick="do_close();" alt="Zoomed Image">
    <span id="close" onclick="do_close();">&times;</span>
</div>
<p></p>
<p></p>
<div>The Big Scarry Corporate Album Of Photos</div>
<div class="gallery">
    <!-- Embed Google Photos album -->
    <iframe src="https://photos.google.com/share/3UEC2VKYippBL8vB9" frameborder="0" width="100%" height="500" allowfullscreen></iframe>
</div>
